def solve():
    s = "t6 t6 t22 t17 t0 t6 t8 t16 t23 t9"

    def generate_string(grammar, input_string):
        stack = []
        for token in input_string:
            if token in grammar.keys():
                stack.append(token)
            elif token in grammar.values():
                stack.append(grammar[token])
            elif token == 't':
                if not stack:
                    return "No"
                stack.pop()
            else:
                return "No"

        if len(stack) == 1:
            return "Yes"
