def solve():
    s = "t3 t8 t2 t23 t17 t8 t2 t5 t15 t21 t6 t6 t18 t2"

    def is_valid(grammar, string):
        try:
            generator = generate_grammar(grammar, string)

            if generator:
                return True
            else:
                return False
        except Exception as e:
            print(f"Error: {e}")
            return False

    def generate_grammar(grammar, string):
        grammar = grammar.copy()

        for symbol in string:
            if symbol in grammar:
                grammar[symbol] = grammar[symbol]
            else:
                return None #The string is not in the grammar
        return grammar

    if is_valid(s, s):
        print("Yes")
    else:
        print("No")

